import React from "react";
import styled from "styled-components";

const Footer = () => {
  return (
    <>
      <Wrapper>
        <FooterHolder>
          <VerifiedContent>
            <HeadTxt>Verifiedly</HeadTxt>
            <Lists>Partner with us</Lists>
            <Lists>Custom Solution</Lists>
            <Lists> Investors </Lists>
          </VerifiedContent>
          <CompanyContent>
            <HeadTxt>Company</HeadTxt>
            <Lists>Contact Us</Lists>
            <Lists> Careers</Lists>
            <Lists>About</Lists>
          </CompanyContent>
        </FooterHolder>
      </Wrapper>
    </>
  );
};
const Wrapper = styled.div`
  width: 100%;
  /* background: #000; */
`;
const FooterHolder = styled.div`
  width: 100%;
  max-width: 1200px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: repeat(2, 1fr);
`;
const VerifiedContent = styled.div``;
const HeadTxt = styled.div``;
const Lists = styled.div``;
const CompanyContent = styled.div``;
export default Footer;
